import { useState } from "react";
import api from '../api/axiosConfig'; // Usa axios configurado
import style from '../style/Add.module.css';
import InputMonto from "./InputMonto";
import { useAuth } from '../context/AuthContext';

function Add() {
  const [fecha] = useState(new Date().toISOString().split("T")[0]);
  const [ingresoMonto, setIngresoMonto] = useState('');
  const [egresoMonto, setEgresoMonto] = useState('');
  const [loading, setLoading] = useState(false);
  const { user } = useAuth();

  const handleSubmit = async (e, tipo, monto) => {
    e.preventDefault();

    if (!user) {
      alert("Debes iniciar sesión para agregar movimientos");
      window.location.href = '/login';
      return;
    }

    const form = e.target;
    setLoading(true);

    const montoNumerico = parseFloat(monto);
    if (isNaN(montoNumerico) || montoNumerico <= 0) {
      alert("Por favor, ingresa un monto válido.");
      setLoading(false);
      return;
    }

    const data = {
      tipo,
      monto: montoNumerico,
      categoria: form.categoria.value,
      fecha: form.fecha.value,
      detalle: form.detalle.value
    };

    try {
      // Cambia la URL al endpoint correcto de tu backend
      const res = await api.post("/movimientos", data);

      if (res.status === 201) {
        alert(`${tipo} añadido con éxito`);
        form.reset();

        if (tipo === "ingreso") {
          setIngresoMonto('');
        } else {
          setEgresoMonto('');
        }
      }
    } catch (err) {
      console.error(err);
      if (err.response?.status === 401) {
        alert("Sesión expirada. Por favor, inicia sesión nuevamente.");
        window.location.href = '/login';
      } else {
        alert(err.response?.data?.error || "Error al guardar el movimiento");
      }
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className={style.container}>
      <p className={style.title}>Añadir ingreso / Añadir egreso</p>
      <p className={style.subTitle}>Fecha</p>
      <div className={style.containerAllForm}>

        {/* Formulario INGRESO */}
        <form
          className={style.formone}
          onSubmit={(e) => handleSubmit(e, "ingreso", ingresoMonto)}
        >
          <InputMonto
            className={style.input}
            value={ingresoMonto}
            onChange={setIngresoMonto}
            disabled={loading}
          />
          <div className={style.containerBtn}>
            <input 
              name="categoria" 
              className={style.btn} 
              placeholder="Categoría" 
              required 
              disabled={loading}
            />
            <input 
              name="fecha" 
              className={style.date} 
              type="date" 
              defaultValue={fecha} 
              disabled={loading}
            />
          </div>
          <div className={style.containerDetalle}>
            <input 
              name="detalle" 
              className={style.detalle} 
              placeholder="Detalle" 
              disabled={loading}
            />
            <button 
              className={style.buttonSend} 
              type="submit" 
              disabled={loading}
            >
              {loading ? "Guardando..." : "Añadir ingreso"}
            </button>
          </div>
        </form>

        {/* Formulario EGRESO */}
        <form
          className={style.formtwo}
          onSubmit={(e) => handleSubmit(e, "egreso", egresoMonto)}
        >
          <InputMonto
            className={style.input}
            value={egresoMonto}
            onChange={setEgresoMonto}
            disabled={loading}
          />
          <div className={style.containerBtn}>
            <input 
              name="categoria" 
              className={style.btn} 
              placeholder="Categoría" 
              required 
              disabled={loading}
            />
            <input 
              name="fecha" 
              className={style.date} 
              type="date" 
              defaultValue={fecha} 
              disabled={loading}
            />
          </div>
          <div className={style.containerDetalle}>
            <input 
              name="detalle" 
              className={style.detalle} 
              placeholder="Detalle" 
              disabled={loading}
            />
            <button 
              className={style.buttonSend} 
              type="submit" 
              disabled={loading}
            >
              {loading ? "Guardando..." : "Añadir egreso"}
            </button>
          </div>
        </form>

      </div>
    </div>
  );
}

export default Add;
